fn is_vowel(c:&char) ->bool{
    match c {
        'a'=> return true,
        'e'=> return true,
        'i'=> return true,
        'o'=> return true,
        'u'=> return true,
        _  => return false
    }
}
pub fn max_vowels(s: String, k: i32) -> i32 {
    let mut l:usize = 0;
    let (mut res, mut total) = (0,0);

    for (i,c) in s.char_indices(){
        if is_vowel(&c) {
            total += 1;
        }
        if (i-l+1)>k as usize {
            if is_vowel(&s.chars().nth(l).unwrap()){
                total-=1;
            }
            l += 1;
        }
        if total > res {
            res = total;
        }
    }
    res
}

fn main() {
    let s = String::from("");
    max_vowels(s, 271);
}
